import { StratusObject } from '../../stratus/object';
import { ICatalystGResponse } from './common';
export interface ICatalystObjectDetails {
    /** Have a type of the object, weather it is a folder or file. */
    key_type?: string;
    /** Name of the key. */
    key: string;
    /** Size of the object. */
    size: number;
    /** Version Id of the object. */
    version_id?: string;
    /** Content type of the object. */
    content_type: string;
    /** Last Modified time of the object. */
    last_modified: string;
    /** Url of the object. */
    object_url?: string;
}
export interface ICatalystObjects {
    /** Number of objects returned. */
    key_count: number;
    /** Max number of objects returned. */
    max_keys?: number;
    /** Status of the more objects in a bucket(present or not). */
    is_truncated: string;
    /** Continuation token for the next request. */
    next_continuation_token?: string;
    /** Details of the returned objects. */
    contents: Array<ICatalystObjectDetails> | Array<StratusObject>;
}
export interface ICatalystObjectVersionDetails {
    /** Id of the object. */
    version_id: string;
    /** Status of the version, weather it is an latest version or not. */
    is_latest?: boolean;
    /** Last modified time of the object with the specified version. */
    last_modified: string;
    /** Size of the object with the specified version. */
    size: string;
    /** The entity tag is a hash of the object. */
    etag: string;
}
export interface ICatalystObjectVersions {
    /** Name of the object. */
    key: string;
    /** Number of version returned. */
    version_count: string;
    /** Continuation token for the next iteration. */
    next_token: string;
    /** Maximum number of version returned. */
    max_versions: string;
    /** Status of the more versions of an object.(present or not). */
    is_truncated?: boolean;
    /** Details of the returned versions of an object. */
    version: Array<ICatalystObjectVersionDetails>;
}
export interface ICatalystUnzipRes {
    /** Name of the object. */
    object_key: string;
    /** Id of the scheduled unzip process. */
    task_id: string;
    /** Destination path where the zipped file will be extracted. */
    destination: string;
    /** Status of the unzip process operation. */
    message: string;
}
export interface ICatalystSignedURLRes {
    /** Signed url for the specified object. */
    signed_url: string;
    /** Expiry time of the signed url. */
    expiry_in_seconds: string;
}
export interface ICatalystPutObjectOptions {
    /** Overwrites the object in a bucket when versioning not enabled. */
    overwrite?: string;
    /** The duration for which the object will remain live.*/
    ttl?: string;
    /** Meta data of an object. */
    metaData?: Record<string, string>;
}
export interface ICatalystBucketMeta {
    /** Status of the versioning(enabled/disabled). */
    versioning: boolean;
    /** Status of the caching(enabled/disabled). */
    caching: {
        status: string;
    };
    /** Status of the encryption(enabled/disabled). */
    encryption: boolean;
    /** Status of the audit_consent(enabled/disabled). */
    audit_consent: boolean;
}
export interface ICatalystBucket extends ICatalystGResponse {
    /** Name of the bucket. */
    bucket_name: string;
    /** Url of the bucket. */
    bucket_url?: string;
    /** Number of objects in a bucket. */
    objects_count?: string;
    /** Size of the bucket. */
    size_in_bytes?: string;
    /** Meta details of the bucket. */
    bucket_meta?: ICatalystBucketMeta;
}
export interface ICatalystCorsRes {
    /** Name of the domain configured in CORS. */
    domain?: string;
    /** Methods allowed for the configured domain. */
    allowed_methods?: Array<string>;
}
export interface ICatalystMultipartSummaryRes {
    /** Name of the bucket. */
    bucket: string;
    /** Name of the object. */
    key: string;
    /** Id of the initiated multipart object. */
    upload_id: string;
    /** Array parts uploaded. */
    parts: Array<{
        /** Part Number for the object part. */
        part_number?: number;
        /** Size of the object part. */
        part_size?: number;
        /** Uploaded time of the object part. */
        uploaded_at?: number;
    }>;
}
export interface ICatalystInitiateUpload {
    /** Name of the bucket. */
    bucket: string;
    /** Name of the object. */
    key: string;
    /** Id for the initiated multipart object. */
    upload_id: string;
    /** Status of the multipart object. */
    status: string;
}
export interface ICatalystPreSignedUrlOptions {
    /** Expiry time of the signed url in seconds. */
    expiryIn?: string;
    /** Date in milliseconds from which the URL becomes valid. */
    activeFrom?: string;
    /** Id of the object to be downloaded. */
    versionId?: string;
}
export interface ICatalystPagedObjectOptions {
    /** Prefix value of the objects to be returned. */
    prefix?: string;
    /** Continuation token to get next set of objects.*/
    continuationToken?: string | undefined;
    /** Maximum number of objects returned. */
    maxKeys?: string;
    /** Return the object as folder structure or individual objects. Based on its value(true/false). */
    folderListing?: string;
}
export interface ICatalystObjectRenameRes {
    /** Name of the object to rename. */
    current_key: string;
    /** Name for the object is renamed to.*/
    rename_to: string;
    /** Status of the rename operation. */
    message: string;
}
